	public void util(JSONObject paramsJson,String url) {
		Map<String, String> params = new HashMap<String, String>();
		params.put("params", AES256Encryption.aes256Encrypt(paramsJson.toString()));
		try {
			String xml = CrawlerWebSousePost.post(url, params);
			if(StringUtils.isEmpty(xml)){
				System.out.println("返回的结果为null");
			}else{
				System.out.println(AES256Encryption.aes256Decrypt(JSONObject.fromObject(xml).getString("result")));
			}
			
		} catch (Exception e) {
			e.printStackTrace();
		}
	}
